import React, { useState, useEffect } from 'react';
import './LandingPage.css';

const loadGoogleMapsScript = () => {
    return new Promise((resolve, reject) => {
        if (window.google) {
            resolve(window.google);
            return;
        }

        const script = document.createElement('script');
        script.src = `https://maps.googleapis.com/maps/api/js?key=${process.env.REACT_APP_GOOGLE_MAPS_API_KEY}&libraries=places`;
        script.async = true;
        script.defer = true;

        script.addEventListener('load', () => {
            if (window.google) {
                resolve(window.google);
            } else {
                reject(new Error('Google Maps failed to load'));
            }
        });

        script.addEventListener('error', () => {
            reject(new Error('Failed to load Google Maps'));
        });

        document.head.appendChild(script);
    });
};

const LandingPage = () => {
    const [searchInput, setSearchInput] = useState('');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [restaurants, setRestaurants] = useState([]);
    const [map, setMap] = useState(null);
    const [service, setService] = useState(null);

    useEffect(() => {
        const initializeGoogleMaps = async () => {
            try {
                await loadGoogleMapsScript();
                const mapInstance = new window.google.maps.Map(
                    document.createElement('div'),
                    { center: { lat: 40.7128, lng: -74.0060 }, zoom: 15 }
                );
                setMap(mapInstance);
                setService(new window.google.maps.places.PlacesService(mapInstance));

                // Initialize autocomplete
                const input = document.getElementById('location-search');
                if (input) {
                    const autocomplete = new window.google.maps.places.Autocomplete(input, {
                        componentRestrictions: { country: "us" }
                    });

                    autocomplete.addListener('place_changed', () => {
                        const place = autocomplete.getPlace();
                        if (place.geometry && place.geometry.location) {
                            setSearchInput(place.formatted_address);
                            searchNearbyRestaurants(
                                place.geometry.location.lat(),
                                place.geometry.location.lng()
                            );
                        }
                    });
                }
            } catch (err) {
                console.error('Error initializing Google Maps:', err);
                setError('Failed to load map services');
            }
        };

        initializeGoogleMaps();
    }, []);

    const searchNearbyRestaurants = async (latitude, longitude) => {
        if (!service) {
            setError('Map services not initialized');
            return;
        }

        setLoading(true);
        setError(null);

        try {
            const request = {
                location: new window.google.maps.LatLng(latitude, longitude),
                radius: 5000,
                type: ['restaurant']
            };

            service.nearbySearch(request, (results, status) => {
                setLoading(false);
                if (status === window.google.maps.places.PlacesServiceStatus.OK) {
                    setRestaurants(results);
                } else {
                    setError('No restaurants found in this area');
                    setRestaurants([]);
                }
            });
        } catch (err) {
            setLoading(false);
            setError('Error searching for restaurants');
            console.error('Search error:', err);
        }
    };

    const handleSearch = () => {
        if (!searchInput) return;

        if (!window.google || !window.google.maps) {
            setError('Map services not available');
            return;
        }

        const geocoder = new window.google.maps.Geocoder();
        geocoder.geocode({ address: searchInput }, (results, status) => {
            if (status === 'OK' && results[0]) {
                const location = results[0].geometry.location;
                searchNearbyRestaurants(location.lat(), location.lng());
            } else {
                setError('Could not find this location');
            }
        });
    };

    return (
        <div className="landing-page">
            <div className="hero-section">
                <h1>Find your next favorite restaurant</h1>
                <div className="main-search">
                    <div className="search-container">
                        <input
                            id="location-search"
                            type="text"
                            placeholder="Enter any address..."
                            className="main-search-input"
                            value={searchInput}
                            onChange={(e) => setSearchInput(e.target.value)}
                            disabled={loading}
                        />
                        <button
                            className="main-search-button"
                            disabled={loading}
                            onClick={handleSearch}
                        >
                            <i className="fas fa-search"></i>
                        </button>
                    </div>

                    {error && (
                        <div className="error-message">
                            {error}
                            <button
                                className="close-error"
                                onClick={() => setError(null)}
                            >
                                <i className="fas fa-times"></i>
                            </button>
                        </div>
                    )}
                </div>
            </div>

            <div className="categories-section">
                <h2>Popular Categories</h2>
                <div className="category-grid">
                    <div className="category-card">
                        <img
                            src="https://images.unsplash.com/photo-1514326640560-7d063ef2aed5?w=400&h=300&q=80"
                            alt="Fine Dining"
                        />
                        <h3>Fine Dining</h3>
                    </div>
                    <div className="category-card">
                        <img
                            src="https://images.unsplash.com/photo-1565299624946-b28f40a0ae38?w=400&h=300&q=80"
                            alt="Casual Dining"
                        />
                        <h3>Casual Dining</h3>
                    </div>
                    <div className="category-card">
                        <img
                            src="https://images.unsplash.com/photo-1513185158878-8d8c2a2a3da3?w=400&h=300&q=80"
                            alt="Fast Food"
                        />
                        <h3>Fast Food</h3>
                    </div>
                </div>
            </div>

            {loading && <div className="loading">Searching for restaurants...</div>}

            {restaurants.length > 0 && (
                <div className="restaurants-section">
                    <h2>Restaurants Near You</h2>
                    <div className="restaurants-grid">
                        {restaurants.map((restaurant) => (
                            <div key={restaurant.place_id} className="restaurant-card">
                                <h3>{restaurant.name}</h3>
                                <p>{restaurant.vicinity}</p>
                                <p>Rating: {restaurant.rating ? `${restaurant.rating} ⭐` : 'No rating'}</p>
                            </div>
                        ))}
                    </div>
                </div>
            )}
        </div>
    );
};

export default LandingPage;
